import MovieCard from 'components/MovieCard/MovieCard';

const MoviesList = ({ movies }) => {
  return (
    <ul>
      {movies.map(({ id, backdrop_path, poster_path, title }) => (
        <MovieCard
          key={id}
          poster={poster_path}
          backdrop={backdrop_path}
          title={title}
        />
      ))}
    </ul>
  );
};

export default MoviesList;
